import React, { Fragment, useState } from 'react';
import { Card, Row, Col, TabContent, TabPane, Nav, NavItem, NavLink } from 'reactstrap';
import { Febric, Video, Details, Brand} from '../../../../../../constant';
import "./styles.css";

const CustomTabsetBottomListingAuctionHelper = () => {
    const [activeTab, setActiveTab] = useState('1');
    return (
        <Fragment>
            <Card>
                <Row className="product-page-main m-0">
                    <Col sm="12">
                    <Nav tabs className="border-tab">
                        <NavItem  id="myTab" role="tablist">
                            <NavLink href={null} className={activeTab === '1' ? 'active' : ''}>
                               {"Comments/Reply's"}
                            </NavLink>
                            <div className="material-border"></div>
                        </NavItem>
                    </Nav>
                    <TabContent activeTab={activeTab}>
                        <TabPane tabId="1">
                            <p className="mb-0 m-t-20"></p>
                        </TabPane>
                    </TabContent>
                    </Col>
                </Row>
            </Card>
        </Fragment>
    );
}

export default CustomTabsetBottomListingAuctionHelper;
